text674431.addInnerText('<div id=\"text674431\" aria-live=\"polite\" ><a id=\"text674431anc\" style=\"display:block;height:0px;width:0px;\"></a>\n<p lang=\"en\"  legLH=\"1.127\" style=\"margin-left:0px;text-indent:0px;line-height:1.080;margin-top:0px;margin-bottom:0px;text-align:left;\" >\n<span class=\"text674431Font4\"  >An active assailant is an individual or group attempting to kill or engaged in killing people in a confined area. In most cases, an active assailant will use a firearm and there is no pattern or method to their selection of victims. <br /><br />Team member safety is our priority. This training will outline the three possible actions that could be taken by the frontline team should an active assailant situation affect a TELUS Retail Limited location. <br /><br />The steps described in this training are based on best practices recommended by law enforcement officials both in Canada and the United States.\n</span ></p >\n</div>\n');
